(($,Drupal,drupalSettings)=>{Drupal.FieldGroup=Drupal.FieldGroup||{};Drupal.FieldGroup.Effects=Drupal.FieldGroup.Effects||{};Drupal.FieldGroup.groupWithFocus=null;Drupal.FieldGroup.setGroupWithFocus=(element)=>{element.css({display:'block'});Drupal.FieldGroup.groupWithFocus=element};Drupal.behaviors.fieldGroup={attach(context,settings){settings.field_group=settings.field_group||drupalSettings.field_group;if(typeof settings.field_group==='undefined'){return}
$.each(Drupal.FieldGroup.Effects,function callback(func){const type=func.toLowerCase().replace('process','');if(typeof settings.field_group[type]!=='undefined'&&typeof this.execute==='function'){this.execute(context,settings,settings.field_group[type])}});$('.group-wrapper fieldset').each((index,element)=>{const elementID=$(element).attr('id');const fieldgroupID=`field_group-${elementID} ${elementID}`;$(element).attr('id',fieldgroupID)});$('.group-wrapper ul li').each((index,element)=>{const fieldGroupNavigationListIndex=$(element).index();$(element).children('a').click(()=>{const fieldset=$('.group-wrapper fieldset').get(fieldGroupNavigationListIndex,);const hashUrl=$(fieldset).attr('id').replace(/^field_group-/,'').split(' ')[0];window.location.hash=hashUrl})})},}})(jQuery,Drupal,drupalSettings)